import React from "react";
import Car from "./Car";
import cars from "../cars";

function createCar(car) {
  return (
    <Car
      key={car.id}
      name={car.name}
      img={car.imgURL}
      tel={car.phone}
      email={car.email}
    />
  );
}

function App() {
  return (
    <div>
      <h1 className="heading">My Cars</h1>
      {cars.map(createCar)}
    </div>
  );
}

export default App;
